import React from 'react';
import { createBrowserRouter, RouterProvider, BrowserRouter } from 'react-router-dom';
import Main from './pages/Main/Main';

function App() {
  const router = createBrowserRouter([
    {
    path: "/",
    element: <Main />,
    }
  ]);

  return (
    <div className="App">
      <BrowserRouter>
      <Main />
    </BrowserRouter>
    </div>
  );
}

export default App;
